AMDOptions.target:
До параметрів дії належать:
	1) імпортування до наявної альбому верхнього рівня, нового альбому або стандартної фототеки;
	2) можливість видалення вихідних файлів після імпортування.

Le opzioni di azione includono:
	1) l'importazione di elementi in un album di livello superiore esistente, in un nuovo album o nella libreria di default;
	2) l'opzione di eliminazione dei file sorgente al termine dell'importazione.
